{
  "type": "object",
  "properties": {
    "code": {
      "type": "integer",
      "format": "int32",
      "description": "响应状态码"
    },
    "data": {
      "type": "object",
      "properties": {
        "accountNo": {
          "type": "string",
          "description": "账户号"
        },
        "accountType": {
          "type": "string",
          "description": "账户类型"
        },
        "rightsVos": {
          "type": "array",
          "description": "权益列表",
          "items": {
            "type": "object",
            "properties": {
              "accountNo": {
                "type": "string",
                "description": "账户号"
              },
              "accountType": {
                "type": "string",
                "description": "账户类型"
              },
              "activateTime": {
                "type": "string",
                "format": "date-time",
                "description": "权益激活时间"
              },
              "agentNo": {
                "type": "string",
                "description": "业务员工号"
              },
              "bnfer": {
                "type": "object",
                "properties": {
                  "birthday": {
                    "type": "string",
                    "format": "date"
                  },
                  "certNo": {
                    "type": "string"
                  },
                  "certType": {
                    "type": "string"
                  },
                  "name": {
                    "type": "string"
                  },
                  "sex": {
                    "type": "string"
                  }
                },
                "title": "UserBo",
                "$$ref": "#/definitions/UserBo"
              },
              "buyer": {
                "type": "object",
                "properties": {
                  "birthday": {
                    "type": "string",
                    "format": "date"
                  },
                  "certNo": {
                    "type": "string"
                  },
                  "certType": {
                    "type": "string"
                  },
                  "name": {
                    "type": "string"
                  },
                  "sex": {
                    "type": "string"
                  }
                },
                "title": "UserBo",
                "$$ref": "#/definitions/UserBo"
              },
              "effBeginDate": {
                "type": "string",
                "format": "date",
                "description": "权益有效起期"
              },
              "effEndDate": {
                "type": "string",
                "format": "date",
                "description": "权益有效止期"
              },
              "generateType": {
                "type": "string",
                "description": "权益生成方式"
              },
              "needActivate": {
                "type": "boolean",
                "description": "（是/否）需要激活"
              },
              "onlyPersonalUse": {
                "type": "boolean",
                "description": "（是/否）仅限本人使用"
              },
              "owner": {
                "type": "object",
                "properties": {
                  "birthday": {
                    "type": "string",
                    "format": "date"
                  },
                  "certNo": {
                    "type": "string"
                  },
                  "certType": {
                    "type": "string"
                  },
                  "name": {
                    "type": "string"
                  },
                  "sex": {
                    "type": "string"
                  }
                },
                "title": "UserBo",
                "$$ref": "#/definitions/UserBo"
              },
              "productCode": {
                "type": "string",
                "description": "产品code"
              },
              "productName": {
                "type": "string",
                "description": "产品名称"
              },
              "productStatus": {
                "type": "string",
                "description": "产品状态（待售，在售，停售）"
              },
              "rightsCreateTime": {
                "type": "string",
                "format": "date-time",
                "description": "权益创建时间"
              },
              "rightsDutyVos": {
                "type": "array",
                "description": "权益责任列表",
                "items": {
                  "type": "object",
                  "properties": {
                    "activateTime": {
                      "type": "string",
                      "format": "date-time",
                      "description": "权益激活时间"
                    },
                    "agentNo": {
                      "type": "string",
                      "description": "业务员工号"
                    },
                    "bnfer": {
                      "type": "object",
                      "properties": {
                        "birthday": {
                          "type": "string",
                          "format": "date"
                        },
                        "certNo": {
                          "type": "string"
                        },
                        "certType": {
                          "type": "string"
                        },
                        "name": {
                          "type": "string"
                        },
                        "sex": {
                          "type": "string"
                        }
                      },
                      "title": "UserBo",
                      "$$ref": "#/definitions/UserBo"
                    },
                    "branchCode": {
                      "type": "string",
                      "description": "分公司码"
                    },
                    "canCancelOrder": {
                      "type": "boolean",
                      "description": "是否可以取消预约"
                    },
                    "createTime": {
                      "type": "string",
                      "format": "date-time",
                      "description": "权益责任落库时间"
                    },
                    "effBeginDate": {
                      "type": "string",
                      "format": "date",
                      "description": "责任有效起期"
                    },
                    "effEndDate": {
                      "type": "string",
                      "format": "date",
                      "description": "责任有效止期"
                    },
                    "needReview": {
                      "type": "boolean",
                      "description": "（是/否）需要预约审核"
                    },
                    "needWaiting": {
                      "type": "boolean",
                      "description": "（是/否）有等待期"
                    },
                    "productDutyCode": {
                      "type": "string",
                      "description": "产品责任号"
                    },
                    "productDutyName": {
                      "type": "string",
                      "description": "产品责任名称"
                    },
                    "remainAmount": {
                      "type": "number",
                      "description": "剩余金额"
                    },
                    "remainNum": {
                      "type": "integer",
                      "format": "int32",
                      "description": "剩余次数"
                    },
                    "rightsDutyNickName": {
                      "type": "string",
                      "description": "权益责任名称"
                    },
                    "rightsDutyNo": {
                      "type": "string",
                      "description": "权益责任号"
                    },
                    "rightsNo": {
                      "type": "string",
                      "description": "权益号"
                    },
                    "scene": {
                      "type": "string",
                      "description": "权益责任场景码"
                    },
                    "status": {
                      "type": "string",
                      "description": "权益责任状态",
                      "enum": [
                        "RightsStateEnum{state='EXPIRE'}",
                        "RightsStateEnum{state='INVALID'}",
                        "RightsStateEnum{state='IN_EFFECTIVE'}",
                        "RightsStateEnum{state='USED'}",
                        "RightsStateEnum{state='VALID'}",
                        "RightsStateEnum{state='CONSUMED'}"
                      ]
                    },
                    "supplierList": {
                      "type": "array",
                      "description": "供应商列表",
                      "items": {
                        "type": "object",
                        "properties": {
                          "address": {
                            "type": "string",
                            "description": "服务地址"
                          },
                          "contactName": {
                            "type": "string",
                            "description": "联系人姓名"
                          },
                          "contactPhone": {
                            "type": "string",
                            "description": "联系电话"
                          },
                          "orgCode": {
                            "type": "string",
                            "description": "社会信用代码"
                          },
                          "supplierId": {
                            "type": "string",
                            "description": "供应商id"
                          },
                          "supplierName": {
                            "type": "string",
                            "description": "供应商名称"
                          }
                        },
                        "title": "SupplierVo",
                        "$$ref": "#/definitions/SupplierVo"
                      }
                    },
                    "template": {
                      "type": "string",
                      "description": "权益责任模板"
                    },
                    "type": {
                      "type": "string",
                      "description": "服务项类型"
                    },
                    "waitingToDate": {
                      "type": "string",
                      "format": "date",
                      "description": "等待止期"
                    }
                  },
                  "title": "RightsDutyVo",
                  "$$ref": "#/definitions/RightsDutyVo"
                }
              },
              "rightsNickName": {
                "type": "string",
                "description": "权益个性化名称"
              },
              "rightsNo": {
                "type": "string",
                "description": "权益号"
              },
              "rightsStatus": {
                "type": "string",
                "description": "权益状态（已购买、已激活、已预约、已使用、已过期）",
                "enum": [
                  "RightsStateEnum{state='EXPIRE'}",
                  "RightsStateEnum{state='INVALID'}",
                  "RightsStateEnum{state='VALID'}",
                  "RightsStateEnum{state='CONSUMED'}",
                  "RightsStateEnum{state='IN_EFFECTIVE'}",
                  "RightsStateEnum{state='USED'}"
                ]
              },
              "scene": {
                "type": "string",
                "description": "权益场景吗"
              },
              "sourceBillNo": {
                "type": "string",
                "description": "来源系统交易号（第三方系统订单号/系统内部订单号"
              },
              "systemSource": {
                "type": "string",
                "description": "系统来源"
              },
              "template": {
                "type": "string",
                "description": "权益模板"
              }
            },
            "title": "CommonRightsVo",
            "$$ref": "#/definitions/CommonRightsVo"
          }
        }
      },
      "title": "AccountRightsVo",
      "$$ref": "#/definitions/AccountRightsVo"
    },
    "errorMessage": {
      "type": "string",
      "description": "响应失败原因"
    },
    "success": {
      "type": "boolean",
      "description": "响应结果"
    }
  },
  "title": "ViewBean«AccountRightsVo»",
  "$$ref": "#/definitions/ViewBean«AccountRightsVo»"
}

